// src/components/Footer.jsx
import React from 'react';
import '../index.css'
import { Instagram, Mail, Linkedin, Phone } from 'lucide-react';
import logoVM from '../assets/images/logoVMbg.png';

const Footer = () => {
  return (
    <section id="footer" style={{ backgroundImage: `url("/assets/images/footertexture.jpg")` }}
    className="relative flex flex-wrap bg-cover bg-center bg-no-repeat outline outline-2 outline-blue justify-center">
      <div className="mt-10 mr-10">
        <p className="font-instrument text-white font-semibold text-lg">Contact</p>
        <div className="flex gap-4 items-center mt-5">
          <Instagram className="text-gold w-12 h-12" />
          <Mail className="text-gold w-12 h-12" />
          <Linkedin className="text-gold w-12 h-12" />
          <Phone className="text-gold w-12 h-12" />
        </div>
      </div>

      <div>
        <img src="/assets/images/bgLogo.jpg" alt="BG Logo" className="w-64 h-40" />
        <img src={logoVM} alt="Logo VM" className="w-[142px]" />
      </div>

      <div>
        <p>About / Education / Experience / Contact</p>
        <p>2025 COPYRIGHT  |  MUHAMMAD VIKHAN MUHARRAM  |  ALL RIGHTS RESERVED </p>
      </div>
    </section>
  );
};

export default Footer;
